  <body>
    <div class="container">
      <div class="header">
        <div class="header-left">
          <div class="header-avatar" id="header-avatar">C</div>
          <div class="header-info">
            <h1>Canlı Sohbet Odası</h1>
            <div class="status-indicator" id="status-indicator">
              <span id="online-count">0</span> kişi çevrimiçi
            </div>
          </div>
        </div>
        <div class="header-actions">
          <button class="header-button">
            <svg
              xmlns="http://www.w3.org/2000/svg"
              width="24"
              height="24"
              viewBox="0 0 24 24"
              fill="none"
              stroke="currentColor"
              stroke-width="2"
              stroke-linecap="round"
              stroke-linejoin="round"
            >
              <circle cx="11" cy="11" r="8"></circle>
              <line x1="21" y1="21" x2="16.65" y2="16.65"></line>
            </svg>
          </button>
          <button class="header-button">
            <svg
              xmlns="http://www.w3.org/2000/svg"
              width="24"
              height="24"
              viewBox="0 0 24 24"
              fill="none"
              stroke="currentColor"
              stroke-width="2"
              stroke-linecap="round"
              stroke-linejoin="round"
            >
              <circle cx="12" cy="12" r="1"></circle>
              <circle cx="12" cy="5" r="1"></circle>
              <circle cx="12" cy="19" r="1"></circle>
            </svg>
          </button>
        </div>
      </div>
      <div class="chat-container" id="chat-container">
        <!-- Messages will be loaded here -->
        <div class="date-divider">
          <span class="date-content">Bugün</span>
        </div>
        <!-- System message example -->
        <div class="system-message">
          Sohbete hoş geldiniz! Lütfen diğer kullanıcılara saygılı olun.
        </div>
      </div>
      <div class="input-container">
        <div class="input-actions">
          <button class="input-button" id="emoji-button">
            <svg
              xmlns="http://www.w3.org/2000/svg"
              width="24"
              height="24"
              viewBox="0 0 24 24"
              fill="none"
              stroke="currentColor"
              stroke-width="2"
              stroke-linecap="round"
              stroke-linejoin="round"
            >
              <circle cx="12" cy="12" r="10"></circle>
              <path d="M8 14s1.5 2 4 2 4-2 4-2"></path>
              <line x1="9" y1="9" x2="9.01" y2="9"></line>
              <line x1="15" y1="9" x2="15.01" y2="9"></line>
            </svg>
          </button>
        </div>
        <div id="message-input-wrapper">
          <input
            type="text"
            id="message-input"
            placeholder="Bir mesaj yazın..."
          />
          <div class="emoji-picker" id="emoji-picker">
            <!-- Emojis will be added via JavaScript -->
          </div>
        </div>
        <button id="send-button">
          <svg
            xmlns="http://www.w3.org/2000/svg"
            width="24"
            height="24"
            viewBox="0 0 24 24"
            fill="none"
            stroke="currentColor"
            stroke-width="2"
            stroke-linecap="round"
            stroke-linejoin="round"
          >
            <path d="M22 2L11 13"></path>
            <path d="M22 2L15 22L11 13L2 9L22 2Z"></path>
          </svg>
        </button>
      </div>
    </div>

    <div class="login-overlay" id="login-overlay">
      <div class="login-box">
        <div class="login-logo">
          <svg
            xmlns="http://www.w3.org/2000/svg"
            width="24"
            height="24"
            viewBox="0 0 24 24"
            fill="none"
            stroke="currentColor"
            stroke-width="2"
            stroke-linecap="round"
            stroke-linejoin="round"
          >
            <path
              d="M21 11.5a8.38 8.38 0 0 1-.9 3.8 8.5 8.5 0 0 1-7.6 4.7 8.38 8.38 0 0 1-3.8-.9L3 21l1.9-5.7a8.38 8.38 0 0 1-.9-3.8 8.5 8.5 0 0 1 4.7-7.6 8.38 8.38 0 0 1 3.8-.9h.5a8.48 8.48 0 0 1 8 8v.5z"
            ></path>
          </svg>
        </div>
        <h2>Sohbete Katıl</h2>
        <input
          type="text"
          id="username-input"
          placeholder="Adınızı girin"
          autofocus
        />
        <button id="join-button">Katıl</button>
      </div>
    </div>
